import React from 'react'

const ImgCont = ({cont}) => {
  return (
     <div>
    <img src='{cont.img}' />
    <h2>{cont.titulo}</h2>
    <p>{cont.parrafo}</p>
    <button>{cont.boton}</button>

    </div>
  )
}

export default ImgCont
